import React from 'react';
import ReactDOM from 'react-dom/client';
import AppState from './components/App';
import AppEffect from './components/AppEffect';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <AppState />
    <AppEffect/>
  </React.StrictMode>
);
